import styled from 'styled-components';

export const Logo = styled.h1`
  font-size: 50px;
  background: red;
  margin: 0 auto;
  text-align: center;
  max-width: fit-content;
  padding: 5px 20px;
  transform: skewX(-7deg);
  color: white;
  cursor: pointer;
  text-transform: uppercase;
  z-index: 2;
`;
